(270, 1, 'Edit Admin', 'admin_viewadmins, '),
(271, 1, 'If you want to put users into different groups with varying access to features (e.g. Bronze, Silver, and Gold membership plans), you can create multiple user groups. You must always have at least one group - your default group (which cannot be deleted). When users signup, they will be placed into the group you have designated as the default group on this page. You can change a user''s group by editing their account from the <a href=''admin_viewusers.php''>View Users</a> page. If you want to give all users on your social network the same features and limits, you will only need one user level.', 'admin_levels, '),
