(690706047, 1, 'Here you can edit wall settings. You can edit how many actions or comments are shown in the wall. Also you can control if Wall photos/music/videos will be synchronized with appropriate plugins. Wall doesn''t require these plugins, it just allows you to synchronize content if you have such plugins.<br /> How synchronization works:<br />- when synchronization is turned on for photos, posted photos will be added to sender''s "Wall Photos" photo album.<br />- when synchronization is turned on for music, posted music will be added to senders music<br />- when synchronization is turned on for video, youtube videos will be added to sender videos<br /><i>It is a paid plugin from Hire-Experts.com</i>', 'wall'),
