(690706104, 1, 'Now you can show wall on any SocialEngine standard page by just putting our special <b>snippet code in yellow colored box</b>. You can open a page template and put snippet code in place where you wanted, for example, you can show wall in User Home:<br />- open `<code>templates/user_home.tpl</code>`  (OR `<code>templates/user_home_core_newsfeed.tpl</code>` if you use Apps & Widgets plugin from SocialEngineMods)<br />- find text like in <u>red colored box</u> and replace it by <u>snippet code in yellow colored box</u><br />- thats''s all, save changes.<br /><br /> If you experience problems then you can use our Professional Plugin Installation service - <a href="http://www.hire-experts.com/services.php">http://www.hire-experts.com/services.php</a>', 'wall'),
