INSERT INTO `se_plugins` (`plugin_id`, `plugin_name`, `plugin_version`, `plugin_type`, `plugin_desc`, `plugin_icon`, `plugin_menu_title`, `plugin_pages_main`, `plugin_pages_level`, `plugin_url_htaccess`, `plugin_disabled`, `plugin_order`) VALUES
(1, 'Chat Plugin', '3.03', 'chat', 'This plugin installs a live chatroom on your social network and adds a link to it on your users'' menu bar. Adding a chatroom is a great way to encourage members to interact more closely and form new connections.', 'chat_chat16.gif', 3500001, '3500002<!>chat_chat16.gif<!>admin_chat.php<~!~>', '3500003<!>admin_levels_chatsettings.php<~!~>', '', 0, 5),
(2, 'Photo Album Plugin', '3.07', 'album', 'This plugin gives your users their own personal photo albums. These albums can be configured to store photos, videos, or any other file types you choose to allow. Users can interact by commenting on each others photos and viewing their friends'' recent updates.', 'album_album16.gif', 1000003, '1000004<!>album_album16.gif<!>admin_viewalbums.php<~!~>1000005<!>album_settings16.gif<!>admin_album.php<~!~>', '1000006<!>admin_levels_albumsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/albums/([0-9]+)/([0-9]+)/?$ $server_info/album_file.php?user=$1&album_id=$2&media_id=$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/albums/([0-9]+)/?$ $server_info/album.php?user=$1&album_id=$2 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/albums/([0-9]+)/([^/]+)?$ $server_info/album.php?user=$1&album_id=$2$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/albums/?$ $server_info/albums.php?user=$1 [L]', 0, 12),
(3, 'Video Plugin', '3.07', 'video', 'This plugin lets your users upload and share videos. Uploaded videos are encoded into Flash files on-the-fly and played via an embedded Flash video player. This is a great way to encourage content creation and personal expression on your social network.', 'video_video16.gif', 5500115, '5500159<!>video_video16.gif<!>admin_video_utilities.php<~!~>5500085<!>video_video16.gif<!>admin_viewvideos.php<~!~>5500116<!>video_settings16.gif<!>admin_video.php<~!~>', '5500045<!>admin_levels_videosettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/videos/([0-9]+)/?$ $server_info/video.php?user=$1&video_id=$2 [L]', 0, 13),
(4, 'Group Plugin', '3.07', 'group', 'This plugin lets your users create their own groups. These groups encourage interactivity between users based on mutual interests and characteristics. Users can become leaders, create private groups, invite members, browse each other''s memberships, and much more.', 'group_group16.gif', 2000001, '2000002<!>group_group16.gif<!>admin_viewgroups.php<~!~>2000003<!>group_settings16.gif<!>admin_group.php<~!~>', '2000004<!>admin_levels_groupsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?group/([0-9]+)/([^/]*)$ $server_info/group.php?group_id=$1$2$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?group/([0-9]+)/album/([0-9]+)/([^/]*)$ $server_info/group_album_file.php?group_id=$2&groupmedia_id=$3$4 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?group/([0-9]+)/discussion/([0-9]+)/([^/]*)$ $server_info/group_discussion_view.php?group_id=$2&grouptopic_id=$3$4 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?group/([0-9]+)/discussion/([0-9]+)/([0-9]+)/([^/]*)$ $server_info/group_discussion_view.php?group_id=$2&grouptopic_id=$3&grouppost_id=$4$5 [L]\r\n', 0, 14),
(5, 'Event Plugin', '3.05', 'event', 'This plugin lets your users create events. Users can create private or public events, invite their friends, RSVP, browse each other''s calendars, and much more. Events encourage users to expand their personal networks by establishing new connections.', 'event_event16.gif', 3000001, '3000002<!>event_event16.gif<!>admin_viewevents.php<~!~>3000003<!>event_settings16.gif<!>admin_event.php<~!~>', '3000004<!>admin_levels_eventsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?event/([0-9]+)/([^/]*)$ $server_info/event.php?event_id=$1$2$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^(.*/)?event/([0-9]+)/album/([0-9]+)/([^/]*)$ $server_info/event_album_file.php?event_id=$2&eventmedia_id=$3$4 [L]\r\n', 0, 15),
(6, 'Forum Plugin', '3.03', 'forum', 'This plugin lets your users interact with each other via threaded forum topics. Users can create new topics, post replies, and attach images or other files. You can also appoint moderators to help manage and organize the discussions. Forums are a great way to generate more return traffic and interactivity within your social network.', 'forum_forum16.gif', 6000001, '6000002<!>forum_forum16.gif<!>admin_forum.php<~!~>6000003<!>forum_settings16.gif<!>admin_forumsettings.php<~!~>', '', '', 0, 7),
(7, 'Education Plugin', '3.03', 'education', 'This plugin allows your user to have multiple education listing on their profile.', 'education16.gif', 11040001, '11040002<!>education16.gif<!>admin_education.php<~!~>', '11040003<!>admin_levels_educationsettings.php<~!~>', '', 1, 16),
(8, 'Blog Plugin', '3.07', 'blog', 'This plugin gives each of your users their own personal blog. This is a great way to encourage content generation and personal expression. Blogs are also an excellent way to improve the search engine visibility of your social network.', 'blog_blog16.gif', 1500001, '1500002<!>blog_blog16.gif<!>admin_viewblogs.php<~!~>1500003<!>blog_adminsettings16.gif<!>admin_blog.php<~!~>', '1500004<!>admin_levels_blogsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\nRewriteRule ^([^/]+)/blog/([0-9]+)/?$ $server_info/blog.php?user=$1&blogentry_id=$2 [L]\nRewriteCond %{REQUEST_FILENAME} !-f\nRewriteRule ^([^/]+)/blog/([^/]+)?$ $server_info/blog.php?user=$1$2 [L]\nRewriteCond %{REQUEST_FILENAME} !-f\nRewriteRule ^([^/]+)/blog/?$ $server_info/blog.php?user=$1 [L]\n\nRewriteCond %{REQUEST_FILENAME} !-f\nRewriteRule ^([^/]+)/trackback/([0-9]+)/?$ $server_info/blog_ajax.php?task=trackback&user=$1&blogentry_id=$2 [L]\n', 1, 9),
(9, 'Poll Plugin', '3.06', 'poll', 'This plugin lets your users create and share their own polls. New polls are highlighted in the recent activity feed, adding an extra source of interactivity on your social network.', 'poll_poll16.gif', 2500001, '2500002<!>poll_poll16.gif<!>admin_viewpolls.php<~!~>2500003<!>poll_adminsettings16.gif<!>admin_poll.php<~!~>', '2500004<!>admin_levels_pollsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/polls/([0-9]+)/?$ $server_info/poll.php?user=$1&poll_id=$2 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/polls/([0-9]+)/([^/]+)?$ $server_info/poll.php?user=$1&poll_id=$2$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/polls/?$ $server_info/polls.php?user=$1 [L]', 0, 10),
(10, 'Quick informer', '1.00', 'qinformer', 'Interactive ajax informer', 'admin_qinformer16.gif', 0, '9000751<!>admin_qinformer16.gif<!>admin_qinformer.php<~!~>', '', '', 1, 11),
(11, 'User Connection Plugin', '3.00', 'userconnection', 'Need to Update : Coming Soon, Nulled by Socialengine.su', 'userconnection_userconnection16.gif', 650002001, '650002001<!>userconnection_userconnection16.gif<!>admin_userconnection.php<~!~>', '', '', 1, 4),
(12, 'ie6check', '3.00', 'ie6check', 'Internet Explorer (IE6), which is still a very widely used browser, does not support many modern web standards, thus leading to a bad user experience for your website on it in many cases. The IE6 Check Plugin detects if a user is using Internet Explorer 6 for visiting your website. It then shows a small message to the user, alerting him that the browser is outdated, and recommending modern browsers to him.', 'ie_detected_icon_16.gif', 650005001, '650005001<!>ie_detected_icon_16.gif<!>admin_ie6check.php', '', '', 0, 8),
(13, 'Music Plugin', '3.02beta', 'music', 'This plugin gives each of your users the ability to upload audio files, which can then be played via a Flash player on their profiles. This is a great way to increase profile customizability and personal expression.', 'music_music16.gif', 4000001, '4000002<!>music_music16.gif<!>admin_viewmusic.php<~!~>', '4000003<!>admin_levels_musicsettings.php<~!~>', '', 1, 6),
(14, 'Wall Plugin', '3.30', 'he_wall', 'THIS PLUGIN IS BROUGHT TO YOU BY WWW.SENULLED.COM', 'he_wall_post_icon.png', 690706001, '690706034<!>he_wall_post_icon.png<!>admin_wall.php<~!~>', '690706035<!>admin_levels_wallsettings.php<~!~>', '', 0, 2),
(15, 'Quiz Plugin', '3.1', 'he_quiz', 'This plugin lets your users create funny quizes like on Facebook. Users can create quizes, browse and pass quizes, see others results, and much more. Quiz plugin increases users activity and makes easy to find friends based on mutual interests.', 'he_quiz_icon.gif', 690691146, '690691180<!>he_quiz_icon.gif<!>admin_viewquizzes.php<~!~>690691146<!>he_quiz_icon.gif<!>admin_quiz_settings.php<~!~>', '', '', 1, 3),
(16, ' ', '3.03', 'article', '          ,  , .           .      ,   ,   .  <a href="http://segooos.com" target="new">Gooos</a>.', 'article16.gif', 11150001, '11150004<!>article16.gif<!>admin_viewarticles.php<~!~>11150002<!>article_settings16.gif<!>admin_article.php<~!~>', '11150003<!>admin_levels_articlesettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/articles/([^/]+)?$ $server_info/articles.php?user=$1$2 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/articles/?$ $server_info/articles.php?user=$1 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^article/([0-9]+)(/[^/]*)?$ $server_info/article.php?article_id=$1&article_slug=$2 [L]', 1, 17),
(17, 'Documents/Scribd iPaper nulled by Sandakelum', '3.05', 'document', 'This plugin allows your users to upload and display documents using Scribd; share, print and download them; add tags to documents, categorize them and give comments.', 'document16.gif', 650003001, '650003002<!>document.gif<!>admin_viewdocuments.php<~!~>650003003<!>document.gif<!>admin_document.php<~!~>650003214<!>document.gif<!>admin_document_category.php<~!~>', '650003004<!>admin_levels_documentsettings.php<~!~>', 'RewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/documents/([0-9]+)/([^/]+)/?$ $server_info/document.php?user=$1&document_id=$2&title=$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/documents/([0-9]+)/([^/]+)?$ $server_info/document.php?user=$1&document_id=$2$3 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/documents/?$ $server_info/documents.php?user=$1 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^([^/]+)/documents/?$ $server_info/documents.php?user=$1 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^documents/tag/([^/]+)/?$ $server_info/browse_documents.php?tag=$1 [L]\r\nRewriteCond %{REQUEST_FILENAME} !-f\r\nRewriteRule ^documents/category/([0-9]+)/?$ $server_info/browse_documents.php?i=$1 [L]', 0, 18),
(18, 'Feedback Reporter', '3.01', 'feedback', 'This plugins allows you to gather user feedbacks for your social network', 'feedback16.gif', 17001000, '17001001<!>feedback16.gif<!>admin_feedback.php<~!~>17001003<!>feedback_settings16.gif<!>admin_feedback_settings.php<~!~>', '', '', 1, 1);
