-color: #000000;\r\n}\r\n\r\n/* Menu Options (below your profile image) */\r\ntable.profile_menu {\r\n	border: 0px;\r\n} \r\n\r\ntd.profile_menu1 a {\r\n	background-color: #333333;\r\n	background-image: none;\r\n	background-repeat: repeat-y;\r\n	background-position: top right;\r\n	border-bottom: 1px solid #444444;\r\n	padding: 5px 5px 5px 7px;\r\n	font-size: 11px;\r\n	font-weight: bold;\r\n}\r\n\r\ntd.profile_menu1 a:hover {\r\n	background-color: #555555;\r\n        color: #ffffff;\r\n	font-weight: bold;\r\n	background-image: none;\r\n}\r\n\r\n/* Comments Section */\r\ndiv.profile_postcomment {\r\n	padding: 8px;\r\n	border: none;\r\n    border-bottom: 1px solid #555555;\r\n    background: #333333;	\r\n    color: #cccccc;\r\n}\r\n\r\ndiv.profile_comment_author {\r\n        background: #333333;\r\n        border-top: 1px solid #666666;\r\n}\r\ndiv.profile_comment_date {\r\n        background: #333333;\r\n        border-top: 1px solid #666666;\r\n}\r\n\r\n/* image verification input */\r\ninput.text, input.text_small {\r\n	border-color: #666666;\r\n	font-size: 12px;\r\n	color: #cccccc;\r\n	background-color: #444444;\r\n}\r\n\r\n/* Events Section */\r\ndiv.profile_event_spacer {\r\n	border-top: 2px solid #555555; \r\n 	margin: 0px 0px 0px 0px;\r\n    padding: 4px;\r\n}\r\n\r\ntd.profile_event_popup_title {\r\n	font-size: 11pt;\r\n	vertical-align: bottom;\r\n	font-weight: bold;\r\n    padding: 10px;\r\n}\r\n\r\ntd.profile_event_popup2 {\r\n	background: #ffffff;\r\n	width: 640px; \r\n	padding: 8px;\r\n}\r\n\r\ntd.profile_event_transparent {\r\n	background: #000000;\r\n	opacity: 0.5; \r\n	filter: alpha(opacity=20); \r\n	-moz-opacity: 0.2;\r\n}'),
(5, 'profile', 'Dark Grey Full', 'darkgrey/darkgrey_basic_images.gif', '/* PROFILE CSS TEMPLATE  */\r\n/* DARKGREY_BASIC_IMAGES */\r\n/* www.solarianoir.net   */\r\n\r\n\r\ntd.menu_user {\r\n  background: #444444;\r\n}\r\ntd.top_menu {\r\n  background: #444444;\r\n}\r\ntd.top_menu2 {\r\n  background: #444444;\r\n}\r\ndiv.top_menu_link, div.top_menu_link_container_end, div.top_menu_link, div.top_menu_link_container, div.top_menu_link_loggedin {\r\n  background: transparent;\r\n}\r\n\r\n\r\ntd.profile_tab a, td.profile_tab a:hover {\r\n	background-color: #333333;\r\n	padding: 7px 10px 7px 10px;\r\n	border: 1px solid #AAAAAA; \r\n	border-left: none;\r\n        border-top: none;\r\n	font-weight: bold; \r\n	display: block;\r\n}\r\ntd.profile_tab a:hover {\r\n	background-color: #444444;\r\n}\r\ntd.profile_tab2 a, td.profile_tab2 a:hover {\r\n	background-color: #222222;\r\n	padding: 7px 10px 8px 10px;\r\n	border: 1px solid #AAAAAA; \r\n	border-left: none;\r\n	border-bottom: none;\r\n        border-top: none;\r\n	font-weight: bold; \r\n	display: block;\r\n}\r\n#profile_tabs_profile { \r\n	border-left: 1px solid #AAAAAA;\r\n}\r\ntd.profile_tab_end {\r\n	border-bottom: 1px solid #AAAAAA;\r\n}\r\n\r\n\r\n/* GLOBAL STYLES */\r\nbody {\r\n	background: #222222;\r\n	cursor: crosshair;\r\n	/* scrollbar colours */ \r\n	scrollbar-face-color: #212121;\r\n	scrollbar-highlight-color: #404040;\r\n	scrollbar-shadow-color: #000000;\r\n	scrollbar-3dlight-color: #616161;\r\n	scrollbar-arrow-color:  #A1A1A1;\r\n	scrollbar-track-color: #000000;\r\n	scrollbar-darkshadow-color: #000000;\r\n    padding-top: 16px; /* distance between top of page and content */\r\n    padding-bottom: 20px; /* distance between bottom of page and content */\r\n}\r\n\r\n/* Top Menu Links */\r\na.top_menu_item:link { color: #cccccc; text-decoration: none; }\r\na.top_menu_item:visited { color: #cccccc; text-decoration: none; }\r\na.top_menu_item:hover { color: #FFFFFF; text-decoration: none; }\r\n\r\n/* LOGGED IN Menu Links */\r\na.menu_item:link { color: #aaaaaa; text-decoration: none; }\r\na.menu_item:visited { color: #aaaaaa; text-decoration: none; }\r\na.menu_item:hover { color: #ffffff; text-decoration: none; }\r\n\r\n/* Global Links */\r\na:link { color: #aaaaaa; text-decoration: none; }\r\na:visited { color: #aaaaaa; text-decoration: none; }\r\na:hover { color: #ffffff; text-decoration: none; }\r\n\r\n/* Content Box */\r\ntd.content {\r\n	background-color: #222222;\r\n	/* distance between outer borders and content box */\r\n	padding: 10px;\r\n}\r\n\r\n/* Applies to most interior content */\r\ndiv, td {\r\n	font-family: arial; /* almost global font */\r\n	font-size: 11px;\r\n	color: #dddddd;\r\n    line-height: 140%; /* distance between lines of text */\r\n	text-align:justify;\r\n}\r\n\r\n\r\n/* TOP Menu */\r\ntd.topbar2, td.topbar2_right {\r\n	border: 0;\r\n	background-color: #222222;\r\n    background-image: url(./images/sample_styles/darkgrey/menu_bg.gif);\r\n	background-repeat: repeat-x; \r\n	font-weight: bold; \r\n	font-size: 16px; \r\n	padding: 10px 8px 10px 8px; \r\n	color: #FFFFFF;\r\n}\r\n\r\n/* User Logged In Menu */\r\ntd.menu {\r\n    background: #333333;\r\n/*    background-image: url(./images/sample_styles/darkgrey/menu2_bg.gif); 	*/\r\n    border-width: 0px;\r\n	border-bottom: 4px;\r\n	border-color: #777777;\r\n    padding-top:10px;\r\n    background-position: bottom;\r\n}\r\n\r\n/* User Logged in Menu Items */\r\ntd.menu_item {\r\n	background: #333333;\r\n/*    background-image: url(./images/sample_styles/darkgrey/menu2_bg.gif); 	*/\r\n	padding-top: 0px;\r\n	padding-right: 6px;\r\n	padding-bottom: 5px;\r\n	padding-left: 6px;\r\n	font-size: 11px;\r\n	font-weight: bold;\r\n	font-family: arial;\r\n    background-position: bottom;\r\n}\r\n\r\n/* User Logged in Menu Shadows */\r\ntd.shadow {\r\n	background: none; \r\n	visibility:hidden;\r\n}\r\n\r\ntd.shadow img {\r\n	display: none;\r\n    visibility:hidden; \r\n}\r\n\r\n/* Yourname''s profile Bar */\r\ndiv.page_header {\r\n	font-size: 16px;\r\n	font-weight: bold;\r\n	color: #ffffff;\r\n	background-color: #333333;\r\n	margin-bottom: 10px;\r\n        padding: 8px 10px 8px 10px;\r\n        border-top: 1px solid #555555;\r\n}\r\n\r\n/* Global Headers - Titles */\r\ntd.header {\r\n	padding: 4px 2px 4px 4px;\r\n	border: 1px solid #666666;\r\n	border-bottom: none;\r\n	font-weight: bold;\r\n	background: #666666;\r\n    background-image: url(./images/sample_styles/darkgrey/header.gif);\r\n	background-repeat: repeat-x;\r\n	color: #ffffff;\r\n	\r\n}\r\n\r\n\r\n\r\n/* PROFILE STYLES */\r\n\r\n/* Profile Box */\r\ntd.profile {\r\n	background-color: #333333;\r\n	background-image: none;\r\n	background-repeat: repeat;\r\n	background-attachment: scroll;\r\n	border-width: 1px; /* adjust the width for styling of content borders */\r\n	border-color: #444444;\r\n	margin-bottom: 0px;\r\n	/* padding values to vary the distance between interior element borders and their content */\r\n	padding-top: 12px;\r\n	padding-right: 12px;\r\n	padding-bottom: 12px; \r\n	padding-left: 12px;\r\n}\r\n\r\n/* Recent Activity */\r\ndiv.profile_action  {\r\n	border-bottom-width: 1px;\r\n	border-bottom-style: solid;\r\n	border-bottom-color: #444444;\r\n	font-size: 14px;\r\n}\r\n\r\n/* Profile Photo */\r\ntd.profile_photo {\r\n	border: 0px solid #aaaaaa;\r\n	padding: 4px;\r\n	background-color: #555555;\r\n    border:1px;\r\n    border-color: #000000;\r\n    border-style: dotted;\r\n}\r\n\r\nimg.photo {\r\n	border-top: 1px;\r\n	border-color: #000000;\r\n}\r\n\r\n/* Menu Options (below your profile image) */\r\ntable.profile_menu {\r\n	border: 0px;\r\n} \r\n\r\ntd.profile_menu1 a {\r\n	background-color: #333333;\r\n	background-image: none;\r\n	background-repeat: repeat-y;\r\n	background-position: top right;\r\n	border-bottom: 1px solid #555555;\r\n	padding: 5px 5px 5px 7px;\r\n	font-size: 11px;\r\n	font-weight: bold;\r\n}\r\n\r\ntd.profile_menu1 a:hover {\r\n	background-color: #555555;\r\n    color: #ffffff;\r\n	font-weight: bold;\r\n	background-image: none;\r\n}\r\n\r\n/* Comments Section */\r\ntd.profile_viewcomments_postcomment {\r\n	padding: 1px;\r\n    color: #cccccc;\r\n	border: 0px solid #CCCCCC;\r\n	background: #333333;\r\n}\r\n\r\ntd.profile_postcomment {\r\n	padding: 18px;\r\n	border: none;\r\n    border-bottom: 1px solid #555555;\r\n    background: #333333;	\r\n    color: #cccccc;\r\n}\r\n\r\ntd.profile_comment_author {\r\n	padding: 5px 7px 5px 7px;\r\n	background: #444444;\r\n}\r\n\r\ntextarea {\r\n	color: #eeeeee;\r\n	height:100px;\r\n	background: #444444; \r\n	border: 0px;\r\n	padding: 12px;\r\n	font-size: 12px;\r\n}\r\n\r\nimg.signup_code {\r\n	background: #ffffff;\r\n	padding: 0px;\r\n	border-width: 2px;\r\n	border-color: #000000;\r\n}\r\n\r\n#dhtmltooltip {\r\n	background: #555555;\r\n	border: 1px solid #AAAAAA;\r\n}\r\n\r\n\r\n/* Events Section */\r\ndiv.profile_event_spacer {\r\n	border-top: 2px solid #555555; \r\n 	margin: 0px 0px 0px 0px;\r\n    padding: 4px;\r\n}\r\ntd.profile_event_popup_title {\r\n	font-size: 11pt;\r\n	vertical-align: bottom;\r\n	font-weight: bold;\r\n    padding: 10px;\r\n}\r\n\r\ntd.profile_event_popup2 {\r\n	background: #ffffff;\r\n	width: 640px; \r\n	padding: 8px;\r\n}\r\n\r\ntd.profile_event_transparent {\r\n	background: #000000;\r\n	opacity: 0.5; \r\n	filter: alpha(opacity=20); \r\n	-moz-opacity: 0.2;\r\n}');
